import React, { useState } from 'react';
import { TextField, Button, Container, Typography, Grid, Paper } from '@mui/material';

function CandidateRegistration() {
    const [formData, setFormData] = useState({
        numCarteElecteur: '',
        email: '',
        telephone: '',
        parti: '',
        slogan: '',
        couleur1: '',
        couleur2: '',
        couleur3: '',
        urlInfo: '',
    });

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log("Candidat enregistré :", formData);
        // Ici, tu peux envoyer `formData` à l'API avec Axios
    };

    return (
        <Container maxWidth="sm">
            <Paper elevation={3} sx={{ padding: 4, marginTop: 4 }}>
                <Typography variant="h5" textAlign="center" gutterBottom>
                    Ajouter un Candidat
                </Typography>
                <form onSubmit={handleSubmit}>
                    <Grid container spacing={2}>
                        <Grid item xs={12}>
                            <TextField
                                fullWidth
                                label="Numéro de carte électeur"
                                name="numCarteElecteur"
                                value={formData.numCarteElecteur}
                                onChange={handleChange}
                                required
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField fullWidth label="Email" name="email" value={formData.email} onChange={handleChange} required />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField fullWidth label="Téléphone" name="telephone" value={formData.telephone} onChange={handleChange} required />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField fullWidth label="Parti politique" name="parti" value={formData.parti} onChange={handleChange} />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField fullWidth label="Slogan" name="slogan" value={formData.slogan} onChange={handleChange} />
                        </Grid>
                        <Grid item xs={4}>
                            <TextField fullWidth label="Couleur 1" name="couleur1" type="color" value={formData.couleur1} onChange={handleChange} />
                        </Grid>
                        <Grid item xs={4}>
                            <TextField fullWidth label="Couleur 2" name="couleur2" type="color" value={formData.couleur2} onChange={handleChange} />
                        </Grid>
                        <Grid item xs={4}>
                            <TextField fullWidth label="Couleur 3" name="couleur3" type="color" value={formData.couleur3} onChange={handleChange} />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField fullWidth label="URL Infos" name="urlInfo" value={formData.urlInfo} onChange={handleChange} />
                        </Grid>
                        <Grid item xs={12}>
                            <Button type="submit" variant="contained" color="primary" fullWidth>
                                Enregistrer le Candidat
                            </Button>
                        </Grid>
                    </Grid>
                </form>
            </Paper>
        </Container>
    );
}

export default CandidateRegistration;
